import { AppBar, Toolbar } from "@mui/material";
import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";

export default function MyAppBar(){

    return(

        //the login link button will be username or mystuff when logged in. Some sort of function
        <div>
            <AppBar position="static">
                <Toolbar sx={{backgroundColor:"wood"}}>
                  <Typography variant="h4" sx={{margin:auto}}>BnB</Typography>
                  <Link  style={{ textDecoration: 'none' }} to={'/listings'}>
                    <Button variant="contained" sx={{justifyContent:right, marginRight: 3, backgroundColor:"gray"}}>View Listings</Button>    
                  </Link>
                  <Link  style={{ textDecoration: 'none' }} to={'/login'}>
                    <Button variant="contained" sx={{justifyContent:right, backgroundColor:"gray"}}>Login</Button>    
                  </Link>
                </Toolbar>
            </AppBar>
        </div>
    )

}
